function FicheEmployer() {
  return (
    <div
      className="col-12 mt-4  me-4 shadow rounded bg-body"
      style={{
        height: "600px",
        boxShadow: "0px 0px 15px -2px 	#B0B0B0",
        borderRadius: "15px",
      }}
    ></div>
  );
}
export default FicheEmployer;
